import React, { useState } from 'react';
import Swal from 'sweetalert2';

const ConfirmationReserve = () => {
  const [parkingOption, setParkingOption] = useState('Parking1');
  const [hoursOption, setHoursOption] = useState('1');

  const handleParkingChange = (e) => {
    const selectedParkingOption = e.target.value;
    setParkingOption(selectedParkingOption);
  };

  const handleHoursChange = (e) => {
    const selectedHoursOption = e.target.value;
    setHoursOption(selectedHoursOption);
  };


  const prices = {
    Parking1: {
      hour: 500,
      shift: 2000, 
      noon: 3500, 
      fullDay: 5000,
    },
    Parking2: {
      hour: 600,
      shift: 2500,
      noon: 4000,
      fullDay: 6000,
    },
    Parking3: {
      hour: 400,
      shift: 1800,
      noon: 3000,
      fullDay: 4500,
    },
  };

  const calculateTotalPrice = () => {
    const selectedPrice = prices[parkingOption];
    const selectedHours = parseInt(hoursOption);

    switch (hoursOption) {
      case '1':
        return selectedPrice.hour;
      case 'turno':
        return selectedPrice.shift;
      case 'medio-dia':
        return selectedPrice.noon;
      case 'dia-completo':
        return selectedPrice.fullDay;
      default:
        return 0;
    }
  };

  const handleConfirmReservation = () => {
    // Aquí puedes enviar la reserva al servidor o realizar alguna acción

    Swal.fire('Reserva realizada con éxito', '', 'success');
  };

  return (
    <div className="container" style={{ width: '50%', marginTop: '50px' }}>
      <div style={{ textAlign: 'center' }}>
          <h1>Confirmación de Reserva</h1>
          <div style={{ width: '100%', backgroundColor: '#F5B041', height: '5px', margin: 'auto', marginBottom: '20px' }}></div>
      </div>
      <form>
        <div className="mb-3" style={{ marginTop: '50px' }}>
          <label htmlFor="parkingOption" className="form-label">
            <h4>Parking</h4>
          </label>
          <select
            className="form-select"
            id="parkingOption"
            name="parkingOption"
            value={parkingOption}
            onChange={handleParkingChange}
          >
            <option value="Parking1">Parking San Martín</option>
            <option value="Parking2">Parking Francia</option>
            <option value="Parking3">Parking Plaza España</option>
          </select>
        </div>
        <div className="mb-3">
          <label htmlFor="hoursOption" className="form-label">
            <h4>Seleccione la duración</h4>
          </label>
          <select
            className="form-select"
            id="hoursOption"
            name="hoursOption"
            value={hoursOption}
            onChange={handleHoursChange}
          >
            <option value="1">1 hora</option>
            <option value="turno">Turno</option>
            <option value="medio-dia">Medio día</option>
            <option value="dia-completo">Día completo</option>
          </select>
        </div>
        <div className="mb-3">
          <label htmlFor="totalPrice" className="form-label">
            <h4>Precio Total</h4>
          </label>
          <input
            type="text"
            className="form-control"
            id="totalPrice"
            name="totalPrice"
            value={`$${calculateTotalPrice()}`} 
            readOnly
          />
        </div>
        <div style={{ textAlign: 'center' }}>
          <button
            type="button"
            className="btn btn-warning text-white"
            onClick={handleConfirmReservation}
          >
            Confirmar Reserva
          </button>
        </div>
      </form>
    </div>
  );
};

export default ConfirmationReserve;
